import React from "react";

const Searcbar = () => {
    let search = "";

    const onChange = (evt) =>{
        console.log(evt.tarjet.value);
        search = evt.tarjet.value; 
    }
    return (
        <div>
            <div>
                <input 
                placeholder="Buscar Pokemon..."
                onChange={onChange}
            />
            </div>
            <div>{search}</div>
        </div>
    )
} 

export default Searcbar;
